var ethersService = new EthersService;

// src/lib/validation.ts
var transactionHashField = t.Lowercase(t.String({
  minLength: 66,
  maxLength: 66,
  title: "Transaction Hash",
  description: "Enter the transaction hash",
  error: "Invalid transaction hash",
  pattern: "^0x[0-9a-fA-F]{64}$",
  examples: [
    "0xe2c48053a3bf3b195a8580905a2810ee7bbf014a2f6045ea52d2ed2a1c9f9e12"
  ]
}));

// src/app.ts
var app = new Elysia({
  name: "main_app",
  prefix: "/api"
}).use(index_default()).get("/health", async () => {
  const isConnected = await ethersService.isConnected();
  return {
    status: isConnected ? "healthy" : "unhealthy",
    service: "Web3 Transaction Verification",
    timestamp: new Date().toISOString(),
    bsc_connection: isConnected
  };
}).get("/rpc/stats", () => {
  const stats = ethersService.getRPCStats();
  return {
    success: true,
    rpc_pool: stats,
    timestamp: new Date().toISOString()
  };
}).get("/usdt/validate/:contract", async ({ params, set: set2 }) => {
  try {
    const contractAddress = params.contract.toLowerCase();
    const validation = await ethersService.validateContractIsUSDT(contractAddress);
    return {
      success: true,
      contract: contractAddress,
      expectedUSDTContract: ethersService.getUSDTContractAddress(),
      validation,
      timestamp: new Date().toISOString()
    };
  } catch (error) {
    set2.status = 500;
    return {
      success: false,
      error: error instanceof Error ? error.message : "Internal server error",
      timestamp: new Date().toISOString()
    };
  }
}, {
  params: t.Object({
    contract: t.String({
      minLength: 42,
      maxLength: 42,
      pattern: "^0x[0-9a-fA-F]{40}$",
      description: "Contract address to validate"
    })
  })
}).get("/block", async () => {
  try {
    const blockNumber = await ethersService.getCurrentBlockNumber();
    return {
      success: true,
      currentBlock: `${blockNumber}`,
      timestamp: new Date().toISOString()
    };
  } catch (error) {
    return {
      success: false,
      error: error instanceof Error ? error.message : "Unknown error",
      timestamp: new Date().toISOString()
    };
  }
}).get("/verify/:hash", async ({ params, set: set2 }) => {
  try {
    params.hash = params.hash.toLowerCase();
    const exists2 = await ethersService.transactionExists(params.hash);
    if (!exists2) {
      set2.status = 404;
      return {
        success: false,
        error: "Transaction not found",
        hash: params.hash,
        timestamp: new Date().toISOString()
      };
    }
    const details = await ethersService.getDetailsByHash(params.hash);
    if (!details) {
      set2.status = 404;
      return {
        success: false,
        error: "Transaction details not found",
        hash: params.hash,
        timestamp: new Date().toISOString()
      };
    }
    console.log(details);
    return {
      success: true,
      hash: params.hash,
      transaction: {
        contract: details.contract?.toLowerCase(),
        toWalletAddress: details.toWalletAddress.toLowerCase(),
        fromWalletAddress: details.fromWalletAddress.toLowerCase(),
        amount: details.amount,
        datetime: details.datetime,
        blockNumber: details.blockNumber,
        gasUsed: details.gasUsed,
        gasPrice: details.gasPrice,
        transactionFee: details.transactionFee,
        status: details.status,
        tokenSymbol: details.tokenSymbol,
        tokenDecimals: details.tokenDecimals,
        isUSDT: details.isUSDT,
        tokenMismatch: details.tokenMismatch,
        expectedContract: details.expectedContract
      },
      validation: {
        isValidUSDT: details.isUSDT && !details.tokenMismatch,
        warning: details.tokenMismatch ? details.contract ? `Transaction involves ${details.tokenSymbol || "unknown token"} instead of USDT` : "Transaction is BNB transfer, not USDT" : null
      },
      timestamp: new Date().toISOString()
    };
  } catch (error) {
    console.error("Verification error:", error);
    set2.status = 500;
    return {
      success: false,
      error: error instanceof Error ? error.message : "Internal server error",
      hash: params.hash,
      timestamp: new Date().toISOString()
    };
  }
}, {
  params: t.Object({
    hash: transactionHashField
  })
}).post("/verify/batch", async ({ body, set: set2 }) => {
  try {
    const results = await Promise.allSettled(body.hashes.map(async (hash3) => {
      const normalizedHash = hash3.toLowerCase();
      try {
        const details = await ethersService.getDetailsByHash(normalizedHash);
        return {
          hash: normalizedHash,
          success: true,
          transaction: details
        };
      } catch (error) {
        return {
          hash: normalizedHash,
          success: false,
          error: error instanceof Error ? error.message : "Unknown error"
        };
      }
    }));
    const response = results.map((result) => result.status === "fulfilled" ? result.value : {
      success: false,
      error: result.reason instanceof Error ? result.reason.message : "Unknown error"
    });
    return {
      success: true,
      results: response,
      timestamp: new Date().toISOString()
    };
  } catch (error) {
    set2.status = 500;
    return {
      success: false,
      error: error instanceof Error ? error.message : "Internal server error",
      timestamp: new Date().toISOString()
    };
  }
}, {
  body: t.Object({
    hashes: t.Array(transactionHashField, {
      minItems: 1,
      maxItems: 10,
      description: "Array of transaction hashes to verify"
    })
  })
});

